import { Link } from "react-router-dom";
const Home = () => {
  const [isEntryPage, setIsEntryPage] = useState(true);
  return (
    <div>
      <Link
        to="/reviews"
        onClick={(event) => {
          setIsEntryPage(true);
        }}
      >
        <p>Click here for a list of reviews</p>
      </Link>
    </div>
  );
};

export default Home;
